import React from 'react';
import logo from './logo.svg';
import './App.css';
<img src=".//navbar-logo.png" alt="navbar logo" height="150px" width="200px"></img>

function App() {
  return (
    <div className="Feed">
      <Navbar />
    </div>
  )
}

class Navbar extends React.Component {
  render() {
    return (
      <div>
        {/* <img src="https://images.vexels.com/media/users/3/137201/isolated/preview/83b5f2a86fa0ec9f938664da94a9bc55-instagram-silhouette-stroke-logo-by-vexels.png" alt="navbar logo" height="150px" width="200px"></img> */}
        <img src=".//navbar-logo.png" alt="navbar logo" height="150px" width="200px"></img>
        <input type="text" placeholder="Search"></input>
        <a href="https://www.google.com" target="_blank"><img src="images/explore-icon.png"/></a>
      </div>
    )
  }
}

export default App;
